            this.setState({posts:[response.data]})
        })
    }
    render()
    {
        const{posts}=this.state
         return(
            <div>

         {this.state.posts.map((e) => (
          <e
          id={'{e.id}'}
          title={'{e.title}'}
          />
        ))}
            <form onSubmit={this.submitHandler}>
            <button type="submit">Click</button>
            </form>           
            </div>
        )
    }
}
